import { loginPageReducer } from "../pages/login/slices/";
import { configureStore } from "@reduxjs/toolkit";
import { productsPageReducer } from "../pages/products/reducers";

const rootReducer = {
    loginPage: loginPageReducer,
    productsPage: productsPageReducer,
};

export const store = configureStore({
    reducer: rootReducer
});
